Not able to delete or find records by id in mongoDB<p>I am saving customer records in Mongo DB, i am using Angular 6 as a front end.
While saving, i am not sending Id value, so automatically Mongo is creating id and saving records.</p>

<p>I am using MongoRepository in Java for saving. But while doing "deleteById" or "findById", its not able to search or delete those records.</p>

<p>Can you help.</p>

<p>Angular Customer Model</p>

<hr>

<pre><code>export interface Customer {
    id : string,
    custId : number,
    customerName : string,
    email: string,
    phone : string,
    age: number,
    city : string,
    state : string,
    createdDate : Date
}
</code></pre>

<p>User.service.ts</p>

<hr>

<pre><code>deleteCustomerData(id): Observable&lt;Customer&gt;{
    console.log(this.deleteCustomerUrl  + id);
    return this.http.delete&lt;Customer&gt;(this.deleteCustomerUrl + id);
  }
</code></pre>

<p>Java Controller</p>

<hr>

<pre><code>@DeleteMapping("/deleteCustomer/{id}")
    public String deleteCustomerById(@PathVariable String id) {
        //ObjectId objId = new ObjectId(id);
        customerService.deleteCustomerById(id);
        return "deleted customer by id"+ id;
    }
</code></pre>

<p>Java Service</p>

<hr>

<pre><code>public void deleteCustomerById(String id) {
        customerRepository.deleteById(id);
    }
</code></pre>

<p>Java Model</p>

<hr>

<pre><code>@Document(collection="Customer")
public class Customer {

    @Id

    private String Id;

    private String customerName;
    private int age;
    private String city;
    private String state;
    private int custId;

}
</code></pre>

<p>Java Repository</p>

<hr>

<pre><code>package com.tivo.extract.config.repository;

import org.springframework.data.mongodb.repository.MongoRepository;

import com.tivo.extract.config.model.Customer;

public interface CustomerRepository extends MongoRepository&lt;Customer, String&gt;{

}
</code></pre>

