Mongo aggregation exclude null fields<p>I have an aggregation pipeline that does <code>$first</code> on multiple fields.</p>

<p>However, in some cases these fields are not present. In these cases, the field's value is returned as <code>null</code>. I need a way to exclude these fields.</p>

<p>I tried to use <code>$ifNull</code> in the <code>$project</code> stage, but it set the value of the fields to <code>false</code> instead of excluding them.</p>

<p><strong>Group stage:</strong></p>

<pre><code>{
  _id: null,
  thisExists: {
    $first: "$thisExists"
  },
  thisDoesNotExist: {
    $first: "$thisDoesNotExist"
  }
}
</code></pre>

<p><strong>Result:</strong></p>

<pre><code>{
    _id:null,
    thisExists:"I exist",
    thisDoesNotExist:null
}
</code></pre>

