Mongoose deleting all documents at every one minute and not accepting time from `expires` and `expireAfterSeconds`<p>We are using express and mongoose, we are trying to remove the document every 1000 seconds in the background, but MongoDB removes at an unexpected time. how to solve it?. also would like to know the difference between <code>expires</code> and <code>expireAfterSeconds</code>.</p>

<p>MongoDB - v3.6.5,
mongoose - 5.4.3,
express - 4.16.4</p>

<p>Sample Model :</p>

<pre><code>const mongoose = require('mongoose');
mongoose.set('useCreateIndex', true);

const forgotPassword = mongoose.Schema({
    email: { type: String, required: [true, 'Email field is required']},
    expiresAt: { type: Date, expires: '2m', default: Date.now }
}, { timestamps: true, versionKey: false, strict: false });

forgotPassword.index({ expiresAt: 1 }, { expireAfterSeconds : 1000 });
module.exports = mongoose.model('forgotpassword', forgotPassword);
</code></pre>

