/*----------------------------------------------------------------.
|    A model needs a scheme that starts with a                    |
|    constant that are named to define the scheme                 |
'-----------------------------------------------------------------*/
let userSchema = new Schema({
    username: {
        type: String,
        required: true,
        min: 4, max: 16,
        unique: true
    },
    password: {
        type: String,
        min: 4,
        required: true
    },
